Here are a few techniques I have learned about:

1. Constant Folding: This technique is used to optimize expressions that contain constants. The compiler replaces the expression with its evaluated value. For example, consider the following code:

```
int x = 2;
int y = 3;
int z = x + y;
```

The compiler can optimize this code by replacing `x + y` with `5`, as the values of `x` and `y` are constants.

2. Dead Code Elimination: This technique is used to remove code that is not used or has no effect on the program's output. For example, consider the following code:

```
int x = 2;
int y = 3;
int z = x + y;
return z;
```

The variable `z` is not used after its assignment, so the compiler can remove the assignment statement and the variable `z` itself.

3. Common Subexpression Elimination: This technique is used to eliminate redundant computations by identifying common subexpressions and computing them only once. For example, consider the following code:

```
int x = 2;
int y = 3;
int z = x + y;
int w = x + y;
```

The expression `x + y` is computed twice, so the compiler can optimize this code by computing it only once and storing the result in a temporary variable.

4. Loop Optimization: This technique is used to optimize loops by reducing the number of iterations or eliminating unnecessary computations. For example, consider the following code:

```
for (int i = 0; i < 1000000; i++) {
    int x = i * 2;
    int y = x + 1;
    int z = y * 2;
    int w = z + 1;
}
```

The compiler can optimize this code by unrolling the loop, which reduces the number of iterations and eliminates some of the redundant computations.

5. Function Inlining: This technique is used to replace a function call with the actual code of the function, which can eliminate the overhead of the function call

